import Mapper from "./UrlMapper"
import '../../styles/Projects/project.css'

export default function Project(props) {
  return (
    <div className="project-container card-wrapper">
      <div className="project-header">
        <p className="project-title">{props.title}</p>
        <a href={props.github_url} target="_blank" className="github-icon"><img src="icons/github.png" /></a>
      </div>
      <div className="project-content">
        {props.children}
      </div>
      <div className="tech-tags">
        {props.tech_tags.split(",").map((item, index)=>
          <a key={item} href={Mapper[item]} target="_blank" >{item}</a>
        )}
      </div>
    </div>
  )
}
